import { Fragment } from 'react';

import AvailableMeals from './AvailableMeals';
import ProductsSummary from './ProductsSummary';

const Products = () => {
	return (
		<Fragment>
			<ProductsSummary />
			<AvailableMeals />
		</Fragment>
	);
};

export default Meals;
